import React from "react";
import "./NewTodo.css";

function NewTodo() {
  return (
    <form className="todo-from">
      <div className="form-group">
        <input type="text" className="form-control" placeholder="Add New TodoItem " />
      </div>
      <button type="submit">Add Todo</button>
    </form>
  );
}

export default NewTodo;
